INSERT INTO `v1_908290e1a6415ffe23c07a89401f6fb930332256b60b78ba416fc891ef2a87bf` VALUES (11, "上出来、上出来。\nさて、絵も完成したことだし、\nみんなでパパっと片づけをして\n食事にでも行くとするかい。", 10, 105611, 1, 14112, 1, 0.5, 0, 14112030, 0);
