INSERT INTO `v1_908290e1a6415ffe23c07a89401f6fb930332256b60b78ba416fc891ef2a87bf` VALUES (11, "むっ、ちょっと待て。\nこの絵のテーマは、繰り返される\n運命の闘争が織りなす限りなき\nウロボロスの循環ではないのか！？", 10, 100911, 1, 18812, 1, 0.5, 0, 18812031, 0);
