INSERT INTO `v1_908290e1a6415ffe23c07a89401f6fb930332256b60b78ba416fc891ef2a87bf` VALUES (11, "はぁ、思わずため息が出るよ。\nかわいいボクが、美しい絵を描く。\nただそれだけで、言葉にできないほど\n尊い場面になってしまうよね？", 10, 100811, 1, 23812, 1, 0.5, 0, 23812026, 0);
