INSERT INTO `v1_908290e1a6415ffe23c07a89401f6fb930332256b60b78ba416fc891ef2a87bf` VALUES (11, "そ、そうですね……\nそんなきれいな風景の中で、\nただ一人辱めを受けている\n自分とかを想像すると……じゅるり♪", 10, 104511, 1, 23812, 1, 0.5, 0, 23812031, 0);
