INSERT INTO `v1_908290e1a6415ffe23c07a89401f6fb930332256b60b78ba416fc891ef2a87bf` VALUES (11, "オー、まさに陰と陽！\nこれがゲージュツの分野で\nいうところの、コントラストと\nいうヤツなのでショウか？", 10, 103011, 1, 23812, 1, 0.5, 0, 23812036, 0);
